import React from 'react';
import { Link } from 'react-router-dom';

const AdminDashboard = () => {
  return (
    <div className="container mx-auto px-4 py-8">
      <h2 className="text-3xl font-bold mb-6">Admin Dashboard</h2>
      <div className="grid grid-cols-1 md:grid-cols-1 gap-6 max-w-md">
        <Link 
          to="/admin/listings" 
          className="bg-blue-500 text-white p-8 rounded-lg shadow hover:bg-blue-600 text-center block"
        >
          <h3 className="text-2xl font-semibold mb-2">Manage Listings</h3>
          <p className="text-lg">Review and approve host listings</p>
        </Link>
      </div>
    </div>
  );
};

export default AdminDashboard;
